import React from 'react';
import ReactDOM from 'react-dom';
import App from "./App";
import './index.css'
import 'bootstrap/dist/css/bootstrap.min.css';
import AdminProvider from './store/adminContext'

ReactDOM.render(
<AdminProvider>
    <App />
</AdminProvider>
, document.getElementById("root"));
